from sympy import binomial
from sympy.utilities.iterables import partitions
colors = 4 - 1   # the number of colors - 1
def t_row( n):
    if n == 0 : return [1]
    t = list( [0] * n)
    for p in partitions( n):
        fact = 1
        s = 0
        for k in p :
            s += p[k]
            fact *= binomial( binomial( k + colors, colors) + p[k] - 1, p[k])
        if s > 0 :
            t[s - 1] += fact
    return [0] + t

